import React from 'react'
import { Props } from './Alies';

type Props2 =  Props & {
    value: string;
  };

const Interception:React.FC<Props2> = ({register,value}) => {
    if (value === "Interception"){
      return (
        <>
            <div className="mx-2 mt-2"><h5>Interception Place</h5></div>
            <select {...register("int_place",{ setValueAs: (value) => Boolean(value), })} className="col-10 col-sm-3">
                    <option value="true">KC</option>
                    <option value="false">LAC</option>
            </select>
            <div className="mx-2 mt-2"><h5>Interception Yards</h5></div>
            <input type="number" {...register("int_yards",{ setValueAs: (value) => parseInt(value), })} className="col-10 col-sm-3"/>
        </>
      )
    }
    return null
  }

export default Interception
